window.onload=()=>{var t=document.querySelectorAll(".nav-link");const n=document.querySelector(".transition");setTimeout(()=>{n.classList.remove("is-active")},200);for(let e=0;e<t.length;e++){const o=t[e];console.log(t),o.addEventListener("click",e=>{e.preventDefault();let t=e.target.href;n.classList.add("is-active"),setInterval(()=>{window.location.href=t},200)})}};const menuBtn=document.querySelector("#navbar-toggle"),menuNav=document.querySelector("#navbar-nav");menuBtn.onclick=function(){menuNav.classList.toggle("active"),menuBtn.classList.toggle("active"),menuBtn.setAttribute("aria-expanded","true"==menuBtn.getAttribute("aria-expanded")?"false":"true")},menuBtn.onkeydown=function(e){"Enter"==e.key&&(menuNav.classList.toggle("active"),e.preventDefault(),menuBtn.setAttribute("aria-expanded","true"==menuBtn.getAttribute("aria-expanded")?"false":"true"))};var scrollpos=window.scrollY,backToTop=document.getElementById("back-to-top");function add_class_on_scroll(){backToTop.classList.add("active")}function remove_class_on_scroll(){backToTop.classList.remove("active")}window.addEventListener("scroll",function(){(250<(scrollpos=window.scrollY)?add_class_on_scroll:remove_class_on_scroll)()});